import logo from './logo.svg';
import './App.css';
import React, {useState, useEffect} from 'react';
function App() {
  const [message, setMessage] = useState([]);
  useEffect(()=>{
    fetch("/api/demo")
    .then((response)=>{
      return response.json();
    })
    .then((data)=>{
      setMessage(data);
      console.log(data)
    });

  },[]);
  return (
    <div className="App">
      {message[0]},{message[1]}
    </div>
  );
}

export default App;
